        var sec = now.getSeconds(); //得到秒
        if (sec < 10) sec = "0" + sec;
        return (
          year +
          "-" +
          month +
          "-" +
          date +
          " " +
          hour +
          ":" +
          minu +
          ":" +
          sec +
          " "
        );
      }
